const Project = () => [
  {
    Img: '../Images/ClassPass_Press_Image32.png',
    link: 'https://www.google.co.in/',
  },
  {
    Img: '',
    link: 'https://www.facebook.com/',
  },
  {
    Img: '',
    link: 'This is link',
  },
  {
    Img: '{ First }',
    link: 'This is link',
  },
];

export default Project;
